import api from './api';
import {
    Routes,
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";
import Atleta from "./Atleta";

function Ranking(){
    
      const [atletas, setAtletas] = React.useState(null);

      React.useEffect(() => {
        api.get('').then((response) => {
          setAtletas(response.data);
        });
      }, []);

      atletas.map(atleta => (
        console.log(atleta.nome)
      ));

        const path = "/atleta/";
        return (
                <div>
                 <h1 id="ranking-title">Atletass</h1>

                  {atletas.map(atleta, index => (
                    <p><NavLink to={path+atleta.nome}>{index+1}ยบ {atleta.nome} - {atleta.pontos}</NavLink></p>
                  ))}
                  </div>
             );
}

export default Ranking;
